@hackini @snnn

To clarify, the telemetry collection is not done by ONNX Runtime to directly send to any Microsoft or other server. Having telemetry enabled in a build only indicates ONNX Runtime participation in the Windows telemetry program - [Trace Logging](https://docs.microsoft.com/en-us/windows/win32/tracelogging/trace-logging-about). 

Trace Logging is the mechanism for Windows to collect events from various applications (locally). With user consent (configured on their Windows machine), the data will be periodically uploaded to the server, where Microsoft only maintains a sampling of anonymized data compliant with GDPR and other privacy regulations. @walrusmcd to keep me honest. We will update the privacy page to make this more clear; thanks for the feedback.
